export const simpleFlatAndReadOnlyExampleWithBulkActions = () => (
  <State store={store}>
    {(state) => (
      <FileBrowser
        icons={Icons.FontAwesome(4)}
        onCreateFolder={(key) => {
          store.set({
            files: store.get('files').concat([
              {
                key: key,
                modified: Date.now(),
                size: (Math.floor(Math.random() * 100) + 1) * 1024,
              },
            ]),
          })
        }}
        onCreateFiles={(files, prefix) => {
          const newFiles = store.get('files')?.map((file) => {
            let newKey = prefix
            if (
              prefix !== '' &&
              prefix.substring(prefix.length - 1, prefix.length) !== '/'
            ) {
              newKey += '/'
            }
            newKey += file.name
            return {
              key: newKey,
              size: file.size,
              modified: Date.now(),
            }
          })

          const uniqueNewFiles = []
          newFiles?.map((newFile) => {
            let exists = false
            state.files?.map((existingFile) => {
              if (existingFile.key === newFile.key) {
                exists = true
              }
            })
            if (!exists) {
              uniqueNewFiles.push(newFile)
            }
          })
          store.set({
            files: store.get('files').concat(uniqueNewFiles),
          })
        }}
        onMoveFolder={(oldKey, newKey) => {
          const newFiles = []
          store.get('files')?.map((file) => {
            if (file.key.substr(0, oldKey.length) === oldKey) {
              newFiles.push({
                ...file,
                key: file.key.replace(oldKey, newKey),
                modified: Date.now(),
              })
            } else {
              newFiles.push(file)
            }
          })
          store.set({
            files: newFiles,
          })
        }}
        onMoveFile={(oldKey, newKey) => {
          const newFiles = []
          store.get('files')?.map((file) => {
            if (file.key === oldKey) {
              newFiles.push({
                ...file,
                key: newKey,
                modified: Date.now(),
              })
            } else {
              newFiles.push(file)
            }
          })
          store.set({
            files: newFiles,
          })
        }}
        onRenameFolder={(oldKey, newKey) => {
          const newFiles = []
          store.get('files')?.map((file) => {
            if (file.key.substr(0, oldKey.length) === oldKey) {
              newFiles.push({
                ...file,
                key: file.key.replace(oldKey, newKey),
                modified: Date.now(),
              })
            } else {
              newFiles.push(file)
            }
          })
          store.set({
            files: newFiles,
          })
        }}
        onRenameFile={(oldKey, newKey) => {
          const newFiles = []
          store.get('files')?.map((file) => {
            if (file.key === oldKey) {
              newFiles.push({
                ...file,
                key: newKey,
                modified: Date.now(),
              })
            } else {
              newFiles.push(file)
            }
          })
          store.set({
            files: newFiles,
          })
        }}
        onDeleteFolder={(folderKeys) => {
          const newFiles = []
          store.get('files')?.map((file) => {
            if (
              !folderKeys.find(
                (folderKey) =>
                  file.key.substr(0, folderKey.length) === folderKey
              )
            ) {
              newFiles.push(file)
            }
          })
          store.set({
            files: newFiles,
          })
        }}
        onDeleteFile={(fileKeys) => {
          store.set({
            files: store
              .get('files')
              .filter((file) => !fileKeys.includes(file.key)),
          })
        }}
        onDownloadFile={(fileKeys) => {
          console.log('Downloading files: ', fileKeys)
        }}
        files={state.files}
      />
    )}
  </State>
)

